import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
	return (
		<>
			<nav>
				<Link to='/'>
					<h1>Br</h1>
				</Link>
				<ul>
					<Link>
						<li>Characters</li>
					</Link>
					<Link>
						<li>Episodes</li>
					</Link>
					<Link>
						<li>Quotes</li>
					</Link>
				</ul>
			</nav>
		</>
	);
}

export default Header;
